import React from 'react'
import Wave from 'react-wavify'

class ShowDays extends React.Component{
    render(){
        return(
            <>
                <Wave fill='#f79902'
                    paused={false}
                    options={{
                        height: 20,
                        amplitude: 20,
                        speed: 0.15,
                        points: 3
                    }}
                />

            </>
        )
    }
}

export default ShowDays;
